import React from 'react';

import SingleKey from './SingleKey/SingleKey';
import classes from './KeyPad.module.css';

const keyPad = (props) => (
    <div className={classes.KeyPad}>
        <SingleKey onClick={() => props.clicked(7)}>7</SingleKey>
        <SingleKey>8</SingleKey>
        <SingleKey>9</SingleKey>
        <SingleKey>4</SingleKey>
        <SingleKey>5</SingleKey>
        <SingleKey>6</SingleKey>
        <SingleKey>1</SingleKey>
        <SingleKey>2</SingleKey>
        <SingleKey>3</SingleKey>
        <SingleKey>.</SingleKey>
        <SingleKey>0</SingleKey>
        <SingleKey>=</SingleKey>
    </div>
);

export default keyPad;
